import React, { Component } from 'react';
import './../css/component/playstore.css';
import { FaNpm, FaGithub } from "react-icons/fa";

class PlayStore extends Component {

    render() {
        return (
            <div className="play-store">
                <a href="/" className="custom-btn d-inline-flex align-items-center"><FaNpm /><p>Available on<span>NPM</span></p></a>
                <a href="/" className="custom-btn d-inline-flex align-items-center"><FaGithub /><p>Available on<span>the App Store</span></p></a>
            </div>
        )
    }
}

export default PlayStore;
